    [],nt"revision_timestamp": "2016-07-27T22:42:10.387379",nt"name": "mercury-in-fishes-of-the-chassahowitzka-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "From August 24 to 28, 1990, spotted seatrout
    (Cynoscion nebulosus), hardhead catfish (Arius felis) and gafftopsail catfish (Bagre
    marinus) were collected from selected locations at the Chassahowitzka National Wildlife
    Refuge, Citrus and Hernando Counties, Florida, for analysis of mercury concentrations
    in muscle tissue. Spotted seatrout were from 260 to 445 mm (10.2-17.5 in) in length.
    Twenty percent of the seatrout had mercury levels in fillets (range = 0.17 to 0.92
    mg/kg wet weight; ppm) that exceeded the Florida limited-consumption concentration
    of 0.5 ppm wet weight. Hardhead catfish were from 268- 412 mm in length and mercury
    concentrations in fillets ranged from 0.10 to 1.28 ppm. Sixteen percent of hardhead
    catfish had mercury concentrations exceeding 0.5 ppm. Gafftopsail catfish were from
    284 to 484 mm (11.2 to 19.1 in) in length. Mercury levels ranged from 0.45 to 0.84
    ppm with one of two samples exceeding the limited-consumption concentration. However,
    no individuals of the fish species contained concentrations which exceeded the Florida
    no-consumption concentration of 1.5 ppm wet weight. Although all locations sampled
    appears to provide environments conducive for accumulation of mercury in fish; concentrations
    in hardhead catfish caught at the mouth of the river were much greater (p<0.001)
    than those in the same species collected at other locations. As all fish collected
    had mercury concentrations in excess of 0.1 ppm, several fish and wildlife trust
    species may be at risk when utilizing the habitat areas sampled. Additional environment
    contaminant studies to determine the scope, magnitude and effects of mercury contamination
    are recommended.",nt"license_title": "License Not Specified",nt"extras":
